import React from "react";
import { Nav, Navbar } from "rsuite";

const BottomNav = () => {
  return (
    <div>
      <Navbar>
        <Nav.Item>
          <button className="primaryButton" style={{ width: "6rem" }}>
            + Project
          </button>
        </Nav.Item>
        <Nav.Item>
          <button className="primaryButton" style={{ width: "8rem" }}>
            + Code Snippet
          </button>
        </Nav.Item>
        <Nav.Item>
          <button className="primaryButton" sytle={{ width: "6rem" }}>
            Settings
          </button>
        </Nav.Item>
      </Navbar>
    </div>
  );
};

export default BottomNav;
